import React from 'react';
import Login from "./pages/Login";

function RegisterationForm() {

  function random(event){
      let email = document.getElementsByClassName("register-email-field").value;
      console.log("Email: " + email);
      // check that a email was entered
      // get email that was entered
      // send -> email, sign up text
      // <Login />
      // <a href="/Login"></a>
  }

  return (
    <form className="register-email-form">
      <h3>Ready to watch? Enter your email to create or restart your membership.</h3>
      <div className="register-email-form-container">
        <ul className="register-email-input">
          <input
            className="register-email-field"
            type="email"
            placeholder="Email Address">
          </input>
        </ul>
        <button className="btn register-btn-start" onClick={random} type="submit" autoComplete="off">
          <span>GET STARTED</span>
          <span style={{"marginLeft": "0.5rem"}}><i className="fas fa-chevron-right"></i></span>
        </button>
      </div>
    </form>
  );
}

export default RegisterationForm;
